    // Heatmap functions
function createHeatmap(data) {
    const heatData = data.features.map(feature => {
        const center = window.turf?.centerOfMass?.(feature) || { geometry: { coordinates: [0, 0] } };
        const intensity = feature.properties.intensity || feature.properties.value || 1;
        return [center.geometry.coordinates[1], center.geometry.coordinates[0], intensity];
    });

    return L.heatLayer(heatData, {
        radius: 20,
        blur: 15,
        maxZoom: 17,
        minOpacity: 0.5,
        gradient: heatmapGradient
    });
}

function loadHeatmapData(hazardType) {
    const heatmapFiles = {
        flood: 'flood.geojson',
        landslide: 'landslide.geojson',
        storm: 'storm_surge.geojson'
    };
    
    if (heatmapFiles[hazardType]) {
        fetch(heatmapFiles[hazardType])
            .then(response => response.json())
            .then(data => {
                // Remove existing heatmap layer if it exists
                if (heatmapLayer && map.hasLayer(heatmapLayer)) {
                    map.removeLayer(heatmapLayer);
                }
                heatmapLayer = createHeatmap(data);
                if (heatmapLayer) heatmapLayer.addTo(map);
            })
            .catch(console.error);
    } else if (heatmapLayer) {
        // Remove heatmap layer if no hazard type is selected
        if (map.hasLayer(heatmapLayer)) {
            map.removeLayer(heatmapLayer);
        }
        heatmapLayer = null;
    }
}

